import React, { useState } from "react";
import {
  LineChart,
  Line,
  XAxis,
  YAxis,
  CartesianGrid,
  Tooltip,
  Legend,
  ResponsiveContainer,
} from "recharts";
import universityData from "./UniversityData";

const studentTypes = ["International", "Domestic"];

export default function App() {
  const [selectedUniversityName, setSelectedUniversityName] = useState("");
  const [selectedSubject, setSelectedSubject] = useState("");
  const [studentType, setStudentType] = useState("International");
  const [cgpa, setCgpa] = useState("");
  const [sat, setSat] = useState("");

  const selectedUniversity = universityData.find(
    (u) => u.name === selectedUniversityName
  );

  const subjectInfo =
    selectedUniversity &&
    selectedUniversity.subjects.find((s) => s.name === selectedSubject);

  const eligibility =
    subjectInfo &&
    subjectInfo.eligibility &&
    subjectInfo.eligibility[studentType];

  const admissionProbability =
    cgpa && sat
      ? (parseFloat(cgpa) >= eligibility?.gpa &&
        parseInt(sat) >= eligibility?.sat
          ? "High"
          : "Low")
      : "";

  return (
    <div style={{ padding: "20px", fontFamily: "Arial" }}>
      <h1>QS World University Rankings Explorer</h1>

      <div>
        <label>Select University:</label>
        <select
          value={selectedUniversityName}
          onChange={(e) => {
            setSelectedUniversityName(e.target.value);
            setSelectedSubject("");
          }}
        >
          <option value="">--Select--</option>
          {universityData.map((uni) => (
            <option key={uni.name} value={uni.name}>
              {uni.name}
            </option>
          ))}
        </select>
      </div>

      {selectedUniversity && (
        <>
          <div>
            <label>Student Type:</label>
            {studentTypes.map((type) => (
              <label key={type} style={{ marginRight: "10px" }}>
                <input
                  type="radio"
                  name="studentType"
                  value={type}
                  checked={studentType === type}
                  onChange={(e) => setStudentType(e.target.value)}
                />
                {type}
              </label>
            ))}
          </div>

          <h2>{selectedUniversity.name}</h2>
          <p><strong>General QS Rank:</strong> {selectedUniversity.generalRank}</p>

          <div>
            <label>Select Subject:</label>
            <select
              value={selectedSubject}
              onChange={(e) => setSelectedSubject(e.target.value)}
            >
              <option value="">--Select--</option>
              {selectedUniversity.subjects?.map((s) => (
                <option key={s.name} value={s.name}>
                  {s.name}
                </option>
              ))}
            </select>
          </div>
        </>
      )}

      {subjectInfo && (
        <>
          <h3>{subjectInfo.name}</h3>
          <p><strong>QS Subject Rank:</strong> {subjectInfo.qsRank}</p>
          <p><strong>Start Date:</strong> {subjectInfo.startDate}</p>
          <p><strong>Fees:</strong> ${subjectInfo.fees}</p>
          <p>
            <strong>Eligibility:</strong>{" "}
            GPA {eligibility?.gpa}+, IELTS {eligibility?.ielts}+, SAT {eligibility?.sat}+
          </p>
          <p><strong>Intakes per Year:</strong> {subjectInfo.intakes}</p>
          <p><strong>Application Deadlines:</strong> {subjectInfo.deadlines}</p>
          <p><strong>Scholarship Info:</strong> {subjectInfo.scholarships}</p>

          <h3>Student Inputs</h3>
          <label>Enter CGPA (out of 10): </label>
          <input
            type="number"
            value={cgpa}
            onChange={(e) => setCgpa(e.target.value)}
          />
          <br />
          <label>Enter SAT Score: </label>
          <input
            type="number"
            value={sat}
            onChange={(e) => setSat(e.target.value)}
          />
          <p>
            <strong>Admission Probability:</strong>{" "}
            {admissionProbability || "Enter both CGPA and SAT to estimate"}
          </p>

          <p><strong>Course Link:</strong> <a href={subjectInfo.link} target="_blank" rel="noreferrer">{subjectInfo.link}</a></p>

          <h3>QS Rankings (Last 5 Years)</h3>
          <table border="1" cellPadding="5">
            <thead>
              <tr>
                <th>Year</th>
                <th>QS Rank</th>
                <th>GPA Cutoff</th>
                <th>SAT Cutoff</th>
              </tr>
            </thead>
            <tbody>
              {subjectInfo.rankings.map((r) => (
                <tr key={r.year}>
                  <td>{r.year}</td>
                  <td>{r.rank}</td>
                  <td>{r.gpa}</td>
                  <td>{r.sat}</td>
                </tr>
              ))}
            </tbody>
          </table>

          <div style={{ height: "300px", marginTop: "30px" }}>
            <ResponsiveContainer width="100%" height="100%">
              <LineChart data={subjectInfo.rankings}>
                <CartesianGrid strokeDasharray="3 3" />
                <XAxis dataKey="year" />
                <YAxis domain={['auto', 'auto']} allowDecimals={false} reversed />
                <Tooltip />
                <Legend />
                <Line type="monotone" dataKey="rank" stroke="#8884d8" />
                <Line type="monotone" dataKey="gpa" stroke="#82ca9d" />
                <Line type="monotone" dataKey="sat" stroke="#ffc658" />
              </LineChart>
            </ResponsiveContainer>
          </div>
        </>
      )}
    </div>
  );
}
